var p='<h1 id="快速开始">快速开始</h1>\n<p>可以选择完整引入本组件库，或只选择部分组件进行引入</p>\n<h2 id="完整引入">完整引入</h2>\n<p>在 <code>main.ts</code> 中写入以下内容</p>\n<pre><code class="language-typescript">import { createApp } from &#39;vue&#39;;\nimport App from &#39;./App.vue&#39;;\nimport JeremyUI from &#39;jeremy-ui&#39;;\nimport &#39;jeremy-ui/lib/jeremy.css&#39;;\n\nconst app = createApp(App);\napp.use(JeremyUI);\napp.mount(&#39;#app&#39;);\n</code></pre>\n<p>这样就完成了对本组件库的引入</p>\n<p>注意，样式文件需要单独引入</p>\n<h2 id="按需引入">按需引入</h2>\n<p>可以直接在主入口中部分引入组件</p>\n<p>但请注意，仍然需要单独引入样式表</p>\n<pre><code class="language-typescript">import { createApp } from &#39;vue&#39;;\nimport App from &#39;./App.vue&#39;;\nimport { JeremyButton, JeremyCard } from &#39;jeremy-ui&#39;;\nimport &#39;jeremy-ui/lib/jeremy.css&#39;;\n\nconst app = createApp(App);\n\napp.use(JeremyButton);\napp.use(JeremyCard);\n\napp.mount(&#39;#app&#39;);\n</code></pre>\n';export{p as default};
